CREATE DEFINER=`root`@`localhost` PROCEDURE `getAllMonthCollectionData`()
BEGIN
SELECT pt.* ,
mem.`name` AS member_name,
mem.memberId AS memberId,
mem.mobile AS mobile,
pt.modeOfPayment AS modeOfPayment,
pt.memberPaymentFor AS memberPaymentFor
FROM .payments AS pt 
LEFT JOIN .members AS mem ON mem.id = pt.memberId
LEFT JOIN .due_paid_payment AS dpp ON dpp.paymentId = pt.id
WHERE MONTH(pt.feePaymentDate) = MONTH(CURRENT_DATE())  
  AND YEAR(pt.feePaymentDate) = YEAR(CURRENT_DATE())
GROUP BY pt.id
ORDER BY pt.id DESC;
END ;;
