CREATE DEFINER=`root`@`localhost` PROCEDURE `getannualSales`(
	IN `customStartDate` VARCHAR(50),
	IN `customEndDate` VARCHAR(50),
	IN `selectedTrainer` VARCHAR(50)
)
BEGIN
SELECT * FROM .members AS mem
WHERE mem.billDate BETWEEN customStartDate AND customEndDate
AND (mem.trainerName = selectedTrainer OR selectedTrainer IS NULL OR selectedTrainer = '')
ORDER BY mem.packagePrice DESC, mem.id DESC;
END ;;
