CREATE DEFINER=`root`@`localhost` PROCEDURE `getDashbaordCount`()
BEGIN

SELECT 
    COUNT(*) AS total_members,
    COUNT(CASE WHEN m.`isActive` = 1 THEN 1 END) AS active_members,
    COUNT(CASE WHEN m.`isActive` = 0 THEN 1 END) AS inactive_members,
    COUNT(CASE WHEN m.`interestedIn` IS NOT NULL AND m.`interestedIn` != 0 THEN 1 END) AS lead_members,
    (SELECT `packageName` FROM 
        (SELECT m.`interestedIn`, IFNULL(p.`packageName`, 'Unknown') AS packageName, COUNT(*) AS count_occurrences 
         FROM `members` m
         LEFT JOIN `packages` p ON m.`interestedIn` = p.`id`
         WHERE m.`interestedIn` IS NOT NULL AND m.`interestedIn` != 0
         GROUP BY m.`interestedIn`, p.`packageName`
         ORDER BY count_occurrences ASC LIMIT 1) AS min_subquery) AS min_interestedIn_package,
    (SELECT `packageName` FROM 
        (SELECT m.`interestedIn`, IFNULL(p.`packageName`, 'Unknown') AS packageName, COUNT(*) AS count_occurrences 
         FROM `members` m
         LEFT JOIN `packages` p ON m.`interestedIn` = p.`id`
         WHERE m.`interestedIn` IS NOT NULL AND m.`interestedIn` != 0
         GROUP BY m.`interestedIn`, p.`packageName`
         ORDER BY count_occurrences DESC LIMIT 1) AS max_subquery) AS max_interestedIn_package,
    COUNT(CASE WHEN m.`endDate` BETWEEN CURDATE() AND DATE_ADD(CURDATE(), INTERVAL 6 MONTH) THEN 1 END) AS half_yearly_members,
    COUNT(CASE WHEN m.`endDate` BETWEEN CURDATE() AND DATE_ADD(CURDATE(), INTERVAL 3 MONTH) THEN 1 END) AS quarterly_members,
    COUNT(CASE WHEN m.`endDate` BETWEEN CURDATE() AND DATE_ADD(CURDATE(), INTERVAL 12 MONTH) THEN 1 END) AS annual_members,
    COUNT(CASE WHEN m.`gender` = 'male' THEN 1 END) AS male_members,
    COUNT(CASE WHEN m.`gender` = 'female' THEN 1 END) AS female_members,
    COUNT(CASE WHEN m.`gender` = 'transgender' THEN 1 END) AS transgender_members,
    COUNT(CASE WHEN DATE_FORMAT(m.`dob`, '%m-%d') = DATE_FORMAT(CURDATE(), '%m-%d') THEN 1 END) AS birthday_members_today,
    COUNT(CASE WHEN a.`id` IS NOT NULL THEN 1 END) AS today_attendance, 
    (COUNT(CASE WHEN m.`isActive` = 1 THEN 1 END) - COUNT(CASE WHEN a.`id` IS NOT NULL THEN 1 END)) AS absent_members,
    
    -- Count members whose package is expiring in 5 days
    COUNT(CASE WHEN m.`endDate` BETWEEN CURDATE() AND DATE_ADD(CURDATE(), INTERVAL 5 DAY) THEN 1 END) AS expiring,
    
    -- Count members whose package has expired
    COUNT(CASE WHEN m.`endDate` < CURDATE() THEN 1 END) AS expired_members

FROM `members` m
LEFT JOIN `attendance` a ON m.`memberId` = a.`memberId` AND a.`date` = CURDATE()
;

