CREATE DEFINER=`root`@`localhost` PROCEDURE `getFellowupLead`(
	IN `fellowup_date` VARCHAR(50)
)
BEGIN

SELECT le.id AS lead_id, le.`name`, le.`mobile`, fe.`reason`, fe.`remarks`, fe.`fellowup_date` 
FROM leads AS le
LEFT JOIN fellowupLead AS fe ON fe.`lead_id` = le.`id` AND fe.`fellowup_date` = fellowup_date
WHERE le.id Not IN  (SELECT lead_id FROM fellowupLead WHERE reason IN  ('NOT INTERESTED','IN ACTIVE'))
ORDER BY fe.`fellowup_date` IS NULL, fe.`fellowup_date`, le.`id`;

END ;;
