CREATE DEFINER=`root`@`localhost` PROCEDURE `getMemberInfoAtt`(
	IN `memberIdval` INT
)
BEGIN

SELECT 
    mm.name,
    mm.endDate,
    mm.memberId,
    pa.packageName AS package_name, 
    CASE 
        WHEN mm.isActive = 1 THEN 'Active' 
        ELSE 'Inactive' 
    END AS status,
    DATE_FORMAT(mm.endDate, '%d-%m-%Y') AS `end_on`,
    DATEDIFF(mm.endDate, CURDATE()) AS `balance`,
    ps.pendingAmount
FROM 
     members AS mm 
left JOIN 
      payments AS ps ON mm.id = REPLACE(ps.memberId,'MEM','')
INNER JOIN 
    packages AS pa ON pa.id = mm.interestedIn
    
WHERE  
    mm.id = memberIdval 
ORDER BY 
    ps.id DESC 
LIMIT 1;


END ;;
DELIMITER ;
