CREATE DEFINER=`root`@`localhost` PROCEDURE `getmonthcollection`(
	IN `customStartDate` VARCHAR(50),
	IN `customEndDate` VARCHAR(50),
	IN `selectedTrainer` VARCHAR(50)
)
BEGIN
SELECT pt.* ,
mem.`name` AS member_name,
mem.memberId AS memberId,
mem.mobile AS mobile,
dpp.modeOfPayment AS modeOfPayment,
dpp.memberPaymentFor AS memberPaymentFor
FROM .payments AS pt 
LEFT JOIN .members AS mem ON mem.id = pt.memberId
LEFT JOIN .due_paid_payment AS dpp ON dpp.paymentId = pt.id
WHERE pt.feePaymentDate BETWEEN customStartDate AND customEndDate
AND (pt.trainerName = selectedTrainer OR selectedTrainer IS NULL OR selectedTrainer = '')
GROUP BY pt.id
ORDER BY pt.id DESC;
END ;;
