CREATE DEFINER=`root`@`localhost` PROCEDURE `gettransactionDashboard`()
BEGIN
SELECT pt.paidAmount AS total_todayCollection
FROM payments AS pt
LEFT JOIN members AS mem ON mem.id = pt.memberId
LEFT JOIN due_paid_payment AS dpp ON dpp.paymentId = pt.id
WHERE DATE(pt.feePaymentDate) = CURRENT_DATE;




SELECT pt.paidAmount AS total_weeklyCollection
FROM payments AS pt
LEFT JOIN members AS mem ON mem.id = pt.memberId
LEFT JOIN due_paid_payment AS dpp ON dpp.paymentId = pt.id
WHERE pt.feePaymentDate >= CURRENT_DATE - INTERVAL 7 DAY;


SELECT SUM(pt.paidAmount) AS total_cashCollection
FROM payments AS pt
WHERE pt.modeOfPayment = 'CASH';




SELECT SUM(pt.paidAmount) AS total_monthly
FROM payments AS pt
WHERE YEAR(pt.feePaymentDate) = YEAR(CURRENT_DATE)
AND MONTH(pt.feePaymentDate) = MONTH(CURRENT_DATE);


SELECT SUM(pt.paidAmount) AS total_upi
FROM .payments AS pt 
WHERE pt.modeOfPayment ='UPI';

SELECT pt.pendingAmount AS total_due
FROM .payments AS pt 
WHERE pt.modeOfPayment ='DUE';


SELECT SUM(pt.paidAmount) AS total_cardCollection
FROM payments AS pt
WHERE pt.modeOfPayment = 'CARD+CASH' AND pt.modeOfPayment ='CARD+UPI';


SELECT SUM(pt.paidAmount) AS total_splitCollection
FROM payments AS pt
WHERE pt.modeOfPayment = 'CARD+CASH' AND pt.modeOfPayment ='CARD+UPI';


END ;;
