CREATE DEFINER=`root`@`localhost` PROCEDURE `getWeekWeeklyCollection`()
BEGIN
SELECT SUM(pt.paidAmount) AS total_weeklyCollection
FROM payments AS pt
WHERE pt.feePaymentDate >= CURRENT_DATE - INTERVAL 7 DAY
AND pt.modeOfPayment ='CARD+CASH' AND pt.modeOfPayment = 'CARD+UPI';
END ;;
